import React from 'react';
import {Project, ProjectImage, ProjectDescription, ProjectTitle,
         Description,Links, Link  } from './ExampleElements';


const Example = ({img, alt, title, description, githubLink, projectLink}) => {
  return (
              <Project>
              <ProjectImage src={img} alt={alt} target='_blank'/>
                  <ProjectDescription>
                      <ProjectTitle>
                          {title}
                      </ProjectTitle>
                      <Description>
                          {description}
                      </Description>
                      <Links>
                      <Link href={githubLink}> github </Link> 
                                              
                      <Link  href={projectLink}> demo </Link>
                      </Links>
                  </ProjectDescription>
              </Project>
  );
};

export default Example;
